import './styles.css';

const Navbar = () => {
  return (
    <nav className="admin-nav-container">
      <ul>
        <li>
          <a href="link" className="admin">
            <p>Produtos</p>
          </a>
        </li>
        <li>
          <a href="link">
            <p>Categorias</p>
          </a>
        </li>
        <li>
          <a href="link">
            <p>Usuarios</p>
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
